import React, { Component } from 'react'

export default class Affair extends Component {
  render(props) {
    return (
        <div>
  
          <div className="affair">
            <h3>{this.props.affair.data}</h3>
            <h4>{this.props.affair.time}</h4>
            <p className="paragraph">{this.props.affair.text}</p>
            <b>{this.props.affair.checked ? 'Молодец' : 'Ждет выполнения...'}</b>
          </div>

      </div>
    )
  }
}
